    window.subtractWorkDays = (date, days) => {
        //if (date.getDay() == 0 || date.getDay() == 6) days++; per aggiungere un giorno se la s cadenza cade di sabato o domenica
        while (days > 0) {
            date.setDate(date.getDate() - 1);
            if (date.getDay() != 0 && date.getDay() != 6) days--;
            if (days == 0 && (date.getDay() == 0 || date.getDay() == 6)) days++;
        }
        return new Date(date);
    }

